import React from 'react';
import { useNavigate } from 'react-router-dom';

const InteractiveImage = () => {
  const navigate = useNavigate();

  // פונקציה שמפעילה ניווט לפי האזור
  const handleAreaClick = (path) => {
    navigate(path);
  };

  return (
    <div>
      <h1>Interactive Building Map</h1>
      <img
        src="frontend/public/img/kanrit.webp"
        alt="Interactive Building"
        useMap="#image-map"
        style={{ maxWidth: '100%', height: 'auto' }}
      />
      <map name="image-map">
        <area
          alt="South"
          title="South"
          coords="834,25,467,596"
          shape="rect"
          onClick={() => handleAreaClick('/south')}
        />
        <area
          alt="North"
          title="North"
          coords="1346,19,1000,596"
          shape="rect"
          onClick={() => handleAreaClick('/north')}
        />
        <area
          alt="Pit"
          title="Pit"
          coords="723,634,1117,995"
          shape="rect"
          onClick={() => handleAreaClick('/pit')}
        />
      </map>
    </div>
  );
};

export default InteractiveImage;
